CREATE TABLE `learning_status` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `vocab_id` int(11) NOT NULL,
  `status` enum('known','unknown') DEFAULT 'unknown',
  `last_reviewed` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `vocab_id` (`vocab_id`),
  CONSTRAINT `learning_status_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `learning_status_ibfk_2` FOREIGN KEY (`vocab_id`) REFERENCES `vocabularies` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `notebook_groups` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;


CREATE TABLE `notebook_shares` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `notebook_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `share_code` varchar(32) NOT NULL,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `share_code` (`share_code`),
  KEY `notebook_id` (`notebook_id`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;


CREATE TABLE `notebooks` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `title` varchar(255) NOT NULL,
  `description` text DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `group_id` int(11) DEFAULT NULL,
  `is_public` tinyint(1) NOT NULL DEFAULT 0,
  `public_token` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `idx_notebooks_public_token` (`public_token`),
  CONSTRAINT `notebooks_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `role` enum('user','admin') DEFAULT 'user',
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  KEY `idx_users_role` (`role`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE `verbs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Infinitive` varchar(50) NOT NULL,
  `Praesens_ich` varchar(50) DEFAULT NULL,
  `Praesens_du` varchar(50) DEFAULT NULL,
  `Praesens_er_sie_es` varchar(50) DEFAULT NULL,
  `Praeteritum_ich` varchar(50) DEFAULT NULL,
  `Partizip_II` varchar(50) DEFAULT NULL,
  `Konjunktiv_II_ich` varchar(50) DEFAULT NULL,
  `Imperativ_Singular` varchar(50) DEFAULT NULL,
  `Imperativ_Plural` varchar(50) DEFAULT NULL,
  `Hilfsverb` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_infinitive` (`Infinitive`)
) ENGINE=InnoDB AUTO_INCREMENT=8048 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `vocabularies` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `notebook_id` int(11) NOT NULL,
  `word` varchar(255) NOT NULL,
  `phonetic` varchar(255) DEFAULT NULL,
  `meaning` text DEFAULT NULL,
  `note` text DEFAULT NULL,
  `plural` varchar(255) DEFAULT NULL,
  `genus` varchar(50) DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `notebook_id` (`notebook_id`),
  CONSTRAINT `vocabularies_ibfk_1` FOREIGN KEY (`notebook_id`) REFERENCES `notebooks` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2065 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


